// src/pages/ContactPage.js
import React from 'react';
import '../styles/ContactPage.css';

const ContactPage = () => {
    return (
        <div className="contact-page" style={{ padding: '2rem', fontFamily: 'Arial, sans-serif' }}>
            <h1 style={{ fontSize: '2.5rem', textAlign: 'center', color: '#333' }}>Contact Me</h1>
            <form className="contact-form" action="https://formspree.io/f/xgedqnry" method="POST">
                <label htmlFor="name">Name</label>
                <input type="text" id="name" name="name" required style={{ padding: '0.5rem', border: '1px solid #ccc', borderRadius: '4px' }} />

                <label htmlFor="email">Email</label>
                <input type="email" id="email" name="email" required style={{ padding: '0.5rem', border: '1px solid #ccc', borderRadius: '4px' }} />

                <label htmlFor="message">Message</label>
                <textarea id="message" name="message" required style={{ padding: '0.5rem', border: '1px solid #ccc', borderRadius: '4px', minHeight: '100px' }}></textarea>

                <button type="submit" style={{ padding: '0.5rem 1rem', backgroundColor: '#007bff', color: '#fff', border: 'none', borderRadius: '4px', cursor: 'pointer' }}>
                    Send Message
                </button>
            </form>
        </div>
    );
};

export default ContactPage;
